import './Board.css';

export default function Board (){

    const word= "pizzman";

    let letterList=[];

    [...word].forEach((char) => {
        letterList.push(<p className = "letter">{char}</p>)
    })


    return(
        <div className = "board">
            <div className = "word">

                {letterList}

            </div>
        </div>
    )

}
